import React, { Component } from 'react'
import styled from 'styled-components'

const StyledNav = styled.p`
  // color: lavender;
  display: inline;
  text-align: right;
  padding: 10px;
  a {
    text-decoration: none;
    color: black
  }
`

const StyledH1 = styled.h1`
  text-align: left;

`

class Nav extends Component {
  render() {
    return (
      <StyledNav>
        <StyledH1>super rad</StyledH1>
        <ul>
          <li><a href="/">sign in</a></li>
          <li><a href="/">blah</a></li>
          <li><a href="">blah</a></li>
        </ul>
      </StyledNav>
    )
  }
}

export default Nav;
